column13:
The invention provides compounds of the formula (I) having protein kinase B inhibiting activity:

wherein A is a saturated hydrocarbon linker group containing from 1 to 7 carbon atoms, the linker group having a maximum chain length of 5 atoms extending between R 1  and NR 2 R 3  and a maximum chain length of 4 atoms extending between E and NR 2 R 3 , wherein one of the carbon atoms in the linker group may optionally be replaced by an oxygen or nitrogen atom; and wherein the carbon atoms of the linker group A may optionally bear one or more substituents selected from oxo, fluorine and hydroxy, provided that the hydroxy group when present is not located at a carbon atom α with respect to the NR 2 R 3  group and provided that the oxo group when present is located at a carbon atom α with respect to the NR 2 R 3  group; 
E is a monocyclic or bicyclic carbocyclic or heterocyclic group; 
R 1  is an aryl or heteroaryl group; and 
R 2 , R 3 , R 4  and R 5  are as defined in the claims. Also provided are pharmaceutical compositions containing the compounds, methods for preparing the compounds and their use as anticancer agents.
